(3, 'pollo al curri con nata', 'preparacion', NULL),
(4, 'pollo en salsa de curry y mango', 'la descripcion de pollo al mango', 'Hervimos la pechuga de pollo en abundante agua salada, con las hojas de laurel y unos granos de pimienta negra, durante unos 20 minutos. Para ahorrar energía, podemos llevar el agua a ebullición, apagar el fuego y dejar que el pollo se cueza lentamente a la vez que se enfría, dentro de la cacerola tapada.\r\n\r\nUna vez frío, retiramos el pollo del líquido de la cocción (del que reservamos un vaso). Escurrimos, deshebramos usando las manos o dos tenedores, colocamos en un cuenco y añadimos la salsa de mango y curry. Nosotros hemos usado salsa de una conocida marca americana, pero podéis hacerla casera con la receta que más os guste.\r\n\r\nSi la mezcla queda muy espesa, añadimos un poco del líquido de la cocción del pollo. Cortamos el pan de pita por la mitad sin llegar al final, dejando una especie de bolsillo en el que introducir el relleno. Tostamos el pan y lo rellenamos con una cama de espinacas frescas, el pollo en salsa y cebolla morada cortada en juliana. Espolvoreamos con sésamo negro y servimos.'),
(5, 'lentejas con chorizo', 'Receta de lentejas con chorizo, un plato sencillo de legumbres ideal para cocinar en la olla rápida.', 'Pela la zanahoria, la cebolla y los dientes de ajo. Corta el chorizo en 4 trozos. Agrega todo a la olla y añade la hoja de laurel. Vierte 3 vasos (3/4 de l) de agua fría, añade sal a tu gusto y la media cucharadita de pimentón dulce.');

